const REST_API = 'http://localhost:9090/addcourses';
class APIService {    
     getBooks(){
        return fetch(REST_API,{ 
            method: 'POST',
                headers: {
                'Accept': 'application/json, text/plain, */*',
                'Content-Type': 'application/json',
                },
                'credentials': 'cross-origin'
        })
        .then(res => res.json());
        console.log(res.json);
    }
    

}

export default APIService;
